import React, { useState } from 'react';
import classes from './storePage_h.module.css';
import ProductsDisplay from '../../containers/productsDisplay_k';

/**
 * Layout for the Store page
 */

const products = [
    {
        name: "red T-shirt",
        categories: ["shirt", "t-shirt", "clothing"],
        img_url: "t-shirt.jpeg",
        rating: 4.5,
        price: 100.32,
        key: 1,
    }, {
        name: "shirt",
        categories: ["shirt", "clothing"],
        img_url: "shirt.jpeg",
        rating: 5,
        price: 13.5,
        key: 2,
    }, {
        name: "plant",
        categories: ["plant"],
        img_url: "plant.jpeg",
        rating: 3.2,
        price: 420.69,
        key: 3,
    }];

const StorePage = () => {
    const [storeName, setStoreName] = useState("abc");

    return (
        <div>
            {storeName}

            <ProductsDisplay
                products={products}
            />
        </div>
    );
};

export default StorePage;
